import React from 'react'
import SidebarButton from './SidebarButton'

const Sidebar = () => {
    return (
        <div className="sidebar">
            <ul>
                <li><SidebarButton text="Home" URL="/"/></li>
                <li><SidebarButton text="New" URL="/"/></li>
            </ul>
        </div>
    )
};

export default Sidebar;
